CREATE TEMP TABLE temp_sal (
	cod_sal           	char(6),
	descricao         	char(70),
	cod_dcb           	char(7),
	nom_dcb           	char(30),
	cod_corp          	varchar(20),
	ind_antimicrobiano	char(1),
	qtd_dias_antimicrb	decimal,
	sn_inativo        	char(1),
	fk_unical         	int,
	vl_dose_maxima    	decimal,
	cd_categoria      	int,
	cd_potenc_emeto   	int,
	nr_dias_meia_vida 	int,
	vl_dose_cumulativa	decimal,
	fk_unidos         	int,
	fk_estabi         	int,
	tp_sal            	char(1),
	vl_concentracao   	decimal,
	vl_volume_final   	decimal,
	fk_calman         	int,
	vl_vol_max_final  	decimal,
	ds_via_regra      	varchar(20),
	fk_corcad         	int,
	cd_calculo        	int,
	sn_qtd_maior_sep  	char(1)
	) with no log;

select cod_sal, descricao, cod_dcb, nom_dcb, cod_corp, ind_antimicrobiano, qtd_dias_antimicrb,
sn_inativo, fk_unical, vl_dose_maxima, cd_categoria, cd_potenc_emeto, nr_dias_meia_vida, vl_dose_cumulativa, fk_unidos,
fk_estabi, tp_sal, vl_concentracao, vl_volume_final, fk_calman, vl_vol_max_final, ds_via_regra, fk_corcad, cd_calculo, sn_qtd_maior_sep
from temp_sal where cod_sal not in (select cod_sal from essalcad);


