select 'update essalcad set descricao = '''||trim(descricao)||''', cod_dcb = '''||trim(cod_dcb)||''', nom_dcb	= '''||trim(nom_dcb)||''', cod_corp = '''||trim(cod_corp)||''', ind_antimicrobiano = '''||trim(ind_antimicrobiano)||''', sn_qtd_maior_sep = '''||trim(sn_qtd_maior_sep)||''', ds_via_regra = '''||trim(ds_via_regra)||''', sn_inativo = '''||trim(sn_inativo)||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal;
select 'update essalcad set cd_potenc_emeto = '''||cd_potenc_emeto||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal where cd_potenc_emeto is not null;
select 'update essalcad set cd_categoria = '''||cd_categoria||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal where cd_categoria is not null;
select 'update essalcad set fk_unical = '''||fk_unical||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal where fk_unical is not null;
select 'update essalcad set fk_unidos = '''||fk_unidos||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal where fk_unidos is not null;
select 'update essalcad set vl_dose_maxima = '''||vl_dose_maxima||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal where vl_dose_maxima is not null;
select 'update essalcad set nr_dias_meia_vida = '''||nr_dias_meia_vida||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal where nr_dias_meia_vida is not null;
select 'update essalcad set vl_dose_cumulativa = '''||vl_dose_cumulativa||''' where cod_sal = '''||trim(cod_sal)||''';' from temp_sal where vl_dose_cumulativa is not null;


